const FORM_ID="#qform",INPUT_QUERY_SELECTOR=".question-radiobox input",NUMBER_OF_RADIO_BUTTON_PER_QUESTION=5,HATE_RANGE=[0,2],LIKE_RANGE=[3,4],chunk=(e,o)=>Array.from({length:Math.ceil(e.length/o)},(n,r)=>e.slice(r*o,r*o+o)),randomInRange=([e,o])=>Math.floor(Math.random()*(o-e+1))+e,makeScoreRangeWithEmotion=e=>e?LIKE_RANGE:HATE_RANGE,resetForm=()=>$(FORM_ID)[0].reset(),getQuestions=()=>{const e=$(INPUT_QUERY_SELECTOR);return chunk(e,5)},scoring=e=>{const o=getQuestions(),n=makeScoreRangeWithEmotion(e);o.forEach(e=>$(e[randomInRange(n)]).prop("checked",!0))},evaluateMember=e=>{resetForm(),scoring(e)},main=void evaluateMember(confirm("Do you like this person?"));